                PARTNERS_METADATA_OGTITLE: "Become a Discord Partner - Exclusive Perks and Rewards",
                PARTNERS_METADATA_DESCRIPTION: "Become a Discord Partner and brand your Discord server with a custom link and invite splash image. Oh yeah, there's a sweet Discord Partner hoodie too.",
                PARTNERS_HERO_LABEL: "Discord Partners",
                PARTNERS_HERO_HEADING: "Discord Partner Program",
                PARTNERS_HERO_TEXT: "We want to support communities that invest time and effort on Discord. Get rewarded for creating an engaged community with our Partner Program.",
                PARTNERS_HOW_TO_APPLY: "How to apply",
                PARTNERS_ABOUT_TITLE: "What it's all about",
                PARTNERS_ABOUT_SUBTITLE: "Designed for active and engaged communities, the Partner Program distinguishes the best servers out there. As role models to all of Discord, Partnered servers are communities that both our new and veteran users can use as inspiration to create their own communities.",
                PARTNERS_ABOUT_BRANDING_TITLE: "Unique branding",
                PARTNERS_ABOUT_BRANDING_SUBTITLE: "Personalize your server with a Custom URL, Server Banner, and Invite Splash.",
                PARTNERS_ABOUT_PERKS_TITLE: "Partner-only perks",
                PARTNERS_ABOUT_PERKS_SUBTITLE: "Get Discord Nitro, rewards for your community, and access to the Partners-only server.",
                PARTNERS_ABOUT_RECOGNIZED_TITLE: "Be recognized",
                PARTNERS_ABOUT_RECOGNIZED_SUBTITLE: "Receive a special badge on your server and stand out from the crowd on our Discovery page.",
                PARTNERS_APPLY_STEP_SET_COMMUNITY_LABEL: "Step 1",
