                PARTNERS_APPLY_STEP_ENGAGEMENT_LABEL: "Step 2",
                PARTNERS_APPLY_STEP_ENGAGEMENT_TEXT: "Once youve set your server to Community, you should see a Partner Program tab. Youll need to hit certain engagement stats before you can apply. Read the requirements [here](https://support.discord.com/hc/articles/115001494012).",
                PARTNERS_APPLY_WHATS_NEXT_TITLE: "Done and done. So, whats next?",
                PARTNERS_APPLY_WHATS_NEXT_SUBTITLE: "While Partnership is not guaranteed, wed love to hear from you. If youve followed the steps above, apply within Discord under the Partner Program tab and well get back to you as fast as bureaucracy will let us. Remember, its not just about the numbers. We take an overall look at your community. Acceptance is based on both quantitative and qualitative factors, and may vary from one candidate to the next.",
                PARTNERS_FEATURED_TITLE: "Meet our Partners",
                PARTNERS_FEATURED_SUBTITLE: "Whether youre a community about learning how to cook, a server about fantasy sports, fans of your favorite game, or anything in between, we support engaged communities and content creators.",
