                PARTNERS_FEATURED_AP_STUDENTS_DESCRIPTION: "Education",
                PARTNERS_FEATURED_BNANS_DESCRIPTION: "Gaming, Content Creator",
                PARTNERS_FAQ_QUESTION_1: "What do you look for in Partners?",
                PARTNERS_FAQ_ANSWER_1_1: "Someone who appreciates me for who I am and likes long walks on the beaches and candle-lit dinners and... wait, I think I misread the question.",
                PARTNERS_FAQ_ANSWER_1_2: "Really, we look for thriving communities and content creators that show an authentic enthusiasm for Discord. We want to support communities that support us. Numbers on other platforms dont always represent a engaged Discord community, so we dont require specific, non-Discord related numbers like views or followers. Acceptance as a Partner is based on your server. More details on what we use to determine acceptance be found above or in our [Help Center article](https://support.discord.com/hc/articles/115001494012). However, meeting these requirements does not guarantee acceptance. Acceptance is based on both quantitative and qualitative factors, and will vary from one candidate to the next.",
                PARTNERS_FAQ_QUESTION_2: "What numbers do I have to hit as a community to be accepted into the Partner Program?",
                PARTNERS_FAQ_ANSWER_2: "Numbers on other platforms dont always represent an active Discord community, so we no longer require non-Discord related numbers like views or followers on other platforms. Instead, acceptance as a Partner is based on your server. Details on what we use to determine acceptance be found in our [Help Center article](https://support.discord.com/hc/articles/115001494012).",
                PARTNERS_FAQ_QUESTION_3: "What perks does my community get from this?",
                PARTNERS_FAQ_ANSWER_3: "Aside from the perks listed above, your server will also get a better bitrate, which is fancy talk for your voice channels will sound better. Were also working on new ways to keep members excited about being a part of your community.",
