                PARTNERS_FAQ_ANSWER_4: "Aside from everything listed above, were always working on new rewards and perks that will encourage communites to stay healthy and engaged with our program. Make sure you join the official Partner server after acceptance and sign up for our newsletter to stay up to date on the program.",
